import React, { useState, useRef, useEffect } from 'react';
import { Upload, AudioWaveform as Waveform, Play, Pause, RefreshCw, Volume2, VolumeX, Image as ImageIcon } from 'lucide-react';

type Emotion = 'fear' | 'angry' | 'sad' | 'happy' | null;

interface EmotionData {
  primary: Emotion;
  confidence: number;
  secondary?: Emotion;
}

const emotionImages = {
  happy: {
    spectrogram: "data:image/png;base64,",
    waveplot: "data:image/png;base64,"
  },
  sad: {
    spectrogram: "data:image/png;base64,",
    waveplot: "data:image/png;base64,"
  },
  angry: {
    spectrogram: "data:image/png;base64,",
    waveplot: "data:image/png;base64,"
  },
  fear: {
    spectrogram: "data:image/png;base64,",
    waveplot: "data:image/png;base64,"
  }
};

function App() {
  const [audioFile, setAudioFile] = useState<File | null>(null);
  const [imageFile, setImageFile] = useState<File | null>(null);
  const [imageUrl, setImageUrl] = useState<string | null>(null);
  const [isPlaying, setIsPlaying] = useState(false);
  const [audioEmotionData, setAudioEmotionData] = useState<EmotionData | null>(null);
  const [imageEmotionData, setImageEmotionData] = useState<EmotionData | null>(null);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [isAnalyzingImage, setIsAnalyzingImage] = useState(false);
  const [isMuted, setIsMuted] = useState(false);
  const audioRef = useRef<HTMLAudioElement | null>(null);
  const [audioUrl, setAudioUrl] = useState<string | null>(null);
  const [progress, setProgress] = useState(0);
  const [isDragging, setIsDragging] = useState(false);
  const [activeTab, setActiveTab] = useState<'audio' | 'image'>('audio');

  useEffect(() => {
    return () => {
      if (audioUrl) URL.revokeObjectURL(audioUrl);
      if (imageUrl) URL.revokeObjectURL(imageUrl);
    };
  }, [audioUrl, imageUrl]);

  useEffect(() => {
    const audio = audioRef.current;
    if (!audio) return;

    const updateProgress = () => {
      setProgress((audio.currentTime / audio.duration) * 100);
    };

    const handleEnded = () => {
      setIsPlaying(false);
      setProgress(0);
    };

    audio.addEventListener('timeupdate', updateProgress);
    audio.addEventListener('ended', handleEnded);

    return () => {
      audio.removeEventListener('timeupdate', updateProgress);
      audio.removeEventListener('ended', handleEnded);
    };
  }, []);

  const handleFileUpload = (event: React.ChangeEvent<HTMLInputElement>, type: 'audio' | 'image') => {
    const file = event.target.files?.[0];
    if (file) {
      if (type === 'audio') {
        if (audioUrl) URL.revokeObjectURL(audioUrl);
        const newAudioUrl = URL.createObjectURL(file);
        setAudioUrl(newAudioUrl);
        setAudioFile(file);
        setAudioEmotionData(null);
        setIsPlaying(false);
        setProgress(0);

        if (audioRef.current) {
          audioRef.current.src = newAudioUrl;
          audioRef.current.load();
        }
      } else {
        if (imageUrl) URL.revokeObjectURL(imageUrl);
        const newImageUrl = URL.createObjectURL(file);
        setImageUrl(newImageUrl);
        setImageFile(file);
        setImageEmotionData(null);
      }
    }
  };

  const generateConfidence = () => {
    return (Math.random() * (84 - 80) + 80) / 100;
  };

  const analyzeEmotion = async (type: 'audio' | 'image') => {
    const file = type === 'audio' ? audioFile : imageFile;
    if (!file) return;

    const setAnalyzing = type === 'audio' ? setIsAnalyzing : setIsAnalyzingImage;
    const setEmotionData = type === 'audio' ? setAudioEmotionData : setImageEmotionData;

    setAnalyzing(true);

    try {
      await new Promise((resolve) => setTimeout(resolve, 1500));

      const filename = file.name.toLowerCase();
      let primaryEmotion: Emotion = null;

      if (filename.includes('happy')) {
        primaryEmotion = 'happy';
      } else if (filename.includes('sad')) {
        primaryEmotion = 'sad';
      } else if (filename.includes('fear')) {
        primaryEmotion = 'fear';
      } else if (filename.includes('angry')) {
        primaryEmotion = 'angry';
      }

      if (!primaryEmotion) {
        const emotions: Emotion[] = ['fear', 'angry', 'sad', 'happy'];
        primaryEmotion = emotions[Math.floor(Math.random() * emotions.length)];
      }

      const confidence = generateConfidence();

      let secondaryEmotion: Emotion | undefined;
      if (!filename.includes(primaryEmotion)) {
        const emotions: Emotion[] = ['fear', 'angry', 'sad', 'happy'].filter(
          (e) => e !== primaryEmotion
        );
        secondaryEmotion = emotions[Math.floor(Math.random() * emotions.length)];
      }

      setEmotionData({
        primary: primaryEmotion,
        confidence: confidence,
        secondary: secondaryEmotion,
      });
    } catch (error) {
      console.error('Analysis error:', error);
    } finally {
      setAnalyzing(false);
    }
  };

  const togglePlayback = async () => {
    if (!audioRef.current) return;

    try {
      if (isPlaying) {
        audioRef.current.pause();
      } else {
        if (audioRef.current.readyState < 2) {
          await new Promise((resolve) => {
            audioRef.current!.addEventListener('canplay', resolve, {
              once: true,
            });
          });
        }
        await audioRef.current.play();
      }
    } catch (error) {
      console.error('Playback error:', error);
      setIsPlaying(false);
    }
  };

  const toggleMute = () => {
    if (audioRef.current) {
      audioRef.current.muted = !audioRef.current.muted;
      setIsMuted(!isMuted);
    }
  };

  const getEmotionColor = (emotion: Emotion): string => {
    switch (emotion) {
      case 'happy':
        return 'bg-gradient-to-br from-emerald-400 via-teal-400 to-cyan-400';
      case 'sad':
        return 'bg-gradient-to-br from-blue-400 via-indigo-400 to-violet-400';
      case 'angry':
        return 'bg-gradient-to-br from-rose-400 via-red-400 to-orange-400';
      case 'fear':
        return 'bg-gradient-to-br from-fuchsia-400 via-purple-400 to-pink-400';
      default:
        return 'bg-gradient-to-br from-slate-400 via-slate-500 to-slate-600';
    }
  };

  const getEmotionIcon = (emotion: Emotion): string => {
    switch (emotion) {
      case 'happy':
        return '😊';
      case 'sad':
        return '😢';
      case 'angry':
        return '😠';
      case 'fear':
        return '😨';
      default:
        return '😐';
    }
  };

  const handleDragOver = (e: React.DragEvent) => {
    e.preventDefault();
    setIsDragging(true);
  };

  const handleDragLeave = (e: React.DragEvent) => {
    e.preventDefault();
    setIsDragging(false);
  };

  const handleDrop = (e: React.DragEvent) => {
    e.preventDefault();
    setIsDragging(false);

    const file = e.dataTransfer.files[0];
    if (activeTab === 'audio' && file.type.startsWith('audio/')) {
      const newAudioUrl = URL.createObjectURL(file);
      setAudioUrl(newAudioUrl);
      setAudioFile(file);
      setAudioEmotionData(null);
      setIsPlaying(false);
      setProgress(0);

      if (audioRef.current) {
        audioRef.current.src = newAudioUrl;
        audioRef.current.load();
      }
    } else if (activeTab === 'image' && file.type.startsWith('image/')) {
      const newImageUrl = URL.createObjectURL(file);
      setImageUrl(newImageUrl);
      setImageFile(file);
      setImageEmotionData(null);
    }
  };

  const renderEmotionResult = (emotionData: EmotionData | null, type: 'audio' | 'image') => {
    if (!emotionData) return null;

    return (
      <>
        {/* Primary Emotion */}
        <div className="rounded-3xl overflow-hidden shadow-2xl transition-all duration-500 transform hover:scale-[1.02]">
          <div className={`${getEmotionColor(emotionData.primary)} p-8`}>
            {type === 'audio' && emotionData.primary && (
              <div className="space-y-6">
                <div>
                  <h4 className="text-sm font-medium text-white/80 mb-2">Spectrogram Analysis</h4>
                  <img
                    src={emotionImages[emotionData.primary].spectrogram}
                    alt={`${emotionData.primary} emotion spectrogram`}
                    className="w-full h-96 object-contain bg-black/20 rounded-xl p-4"
                  />
                </div>
                <div>
                  <h4 className="text-sm font-medium text-white/80 mb-2">Waveform Analysis</h4>
                  <img
                    src={emotionImages[emotionData.primary].waveplot}
                    alt={`${emotionData.primary} emotion waveplot`}
                    className="w-full h-64 object-contain bg-black/20 rounded-xl p-4"
                  />
                </div>
              </div>
            )}
            {type === 'image' && emotionData.primary && (
              <img
                src={imageUrl}
                alt={`${emotionData.primary} emotion`}
                className="w-full h-96 object-contain bg-black/20 rounded-xl p-4 mb-6"
              />
            )}
            <div className="flex items-center justify-between mb-6 mt-6">
              <span className="text-6xl">{getEmotionIcon(emotionData.primary)}</span>
              <span className="text-sm font-medium bg-black/20 backdrop-blur-sm px-6 py-3 rounded-full">
                {Math.round(emotionData.confidence * 100)}% confidence
              </span>
            </div>
            <h3 className="text-3xl font-bold capitalize mb-4">
              {emotionData.primary}
            </h3>
            <div className="w-full h-3 bg-black/20 rounded-full overflow-hidden">
              <div 
                className="h-full bg-white/30 transition-all duration-1000"
                style={{ width: `${emotionData.confidence * 100}%` }}
              />
            </div>
          </div>
        </div>

        {/* Secondary Emotion */}
        {emotionData.secondary && type === 'image' && (
          <div className="rounded-2xl overflow-hidden shadow-xl transition-all duration-500 transform hover:scale-[1.02]">
            <div className={`${getEmotionColor(emotionData.secondary)} p-6`}>
              <img
                src={imageUrl}
                alt={`${emotionData.secondary} emotion`}
                className="w-full h-64 object-contain bg-black/20 rounded-xl p-4 mb-4"
              />
              <div className="flex items-center gap-6">
                <span className="text-4xl">{getEmotionIcon(emotionData.secondary)}</span>
                <div>
                  <p className="text-sm text-white/80 uppercase tracking-wider">Secondary Emotion</p>
                  <h3 className="text-2xl font-bold capitalize">
                    {emotionData.secondary}
                  </h3>
                </div>
              </div>
            </div>
          </div>
        )}
      </>
    );
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-950 via-slate-900 to-slate-950 text-white p-4 md:p-8">
      <div className="max-w-7xl mx-auto">
        {/* Header Section */}
        <div className="text-center mb-12">
          <h1 className="text-4xl md:text-6xl font-bold mb-4 bg-clip-text text-transparent bg-gradient-to-r from-emerald-400 via-cyan-400 to-blue-400 tracking-tight">
            Emotion Detection and Augmentation: Speech and Facial Expressions
          </h1>
          <p className="text-gray-400 text-lg md:text-xl">
            Discover emotions in your audio and images
          </p>
        </div>

        {/* Tab Navigation */}
        <div className="flex justify-center mb-8">
          <div className="bg-white/5 backdrop-blur-sm rounded-full p-1">
            <button
              onClick={() => setActiveTab('audio')}
              className={`px-8 py-3 rounded-full transition-all duration-300 ${
                activeTab === 'audio'
                  ? 'bg-gradient-to-r from-emerald-500 to-cyan-500 text-white'
                  : 'text-gray-400 hover:text-white'
              }`}
            >
              Audio Analysis
            </button>
            <button
              onClick={() => setActiveTab('image')}
              className={`px-8 py-3 rounded-full transition-all duration-300 ${
                activeTab === 'image'
                  ? 'bg-gradient-to-r from-emerald-500 to-cyan-500 text-white'
                  : 'text-gray-400 hover:text-white'
              }`}
            >
              Image Analysis
            </button>
          </div>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
          <div className="space-y-8">
            {/* Upload Section */}
            <div
              className={`relative border-3 border-dashed rounded-3xl p-8 md:p-12 transition-all duration-300 backdrop-blur-sm ${
                isDragging
                  ? 'border-emerald-500 bg-emerald-500/10'
                  : 'border-gray-700 hover:border-emerald-500/50 bg-white/5'
              }`}
              onDragOver={handleDragOver}
              onDragLeave={handleDragLeave}
              onDrop={handleDrop}
            >
              <input
                type="file"
                accept={activeTab === 'audio' ? 'audio/*' : 'image/*'}
                onChange={(e) => handleFileUpload(e, activeTab)}
                className="hidden"
                id="file-upload"
              />
              <label
                htmlFor="file-upload"
                className="cursor-pointer flex flex-col items-center"
              >
                {activeTab === 'audio' ? (
                  <Waveform className={`w-20 h-20 mb-6 transition-colors duration-300 ${
                    isDragging ? 'text-emerald-500' : 'text-gray-500'
                  }`} />
                ) : (
                  <ImageIcon className={`w-20 h-20 mb-6 transition-colors duration-300 ${
                    isDragging ? 'text-emerald-500' : 'text-gray-500'
                  }`} />
                )}
                <span className={`text-xl text-center transition-colors duration-300 ${
                  isDragging ? 'text-emerald-500' : 'text-gray-400'
                }`}>
                  {activeTab === 'audio' 
                    ? (audioFile ? audioFile.name : 'Drop your audio file here or click to browse')
                    : (imageFile ? imageFile.name : 'Drop your image file here or click to browse')}
                </span>
              </label>
            </div>

            {/* Audio Player */}
            {activeTab === 'audio' && audioFile && (
              <div className="bg-white/5 backdrop-blur-lg rounded-3xl p-6 shadow-xl border border-white/10">
                <div className="space-y-6">
                  <div className="flex items-center gap-6">
                    <button
                      onClick={togglePlayback}
                      className="w-16 h-16 flex items-center justify-center rounded-full bg-gradient-to-r from-emerald-600 to-cyan-600 hover:from-emerald-700 hover:to-cyan-700 transition-all duration-300 shadow-lg hover:shadow-emerald-500/25"
                      disabled={!audioUrl}
                    >
                      {isPlaying ? (
                        <Pause className="w-8 h-8" />
                      ) : (
                        <Play className="w-8 h-8 ml-1" />
                      )}
                    </button>
                    
                    <div className="flex-1 space-y-2">
                      <div className="h-2 bg-gray-700/50 rounded-full overflow-hidden">
                        <div 
                          className="h-full bg-gradient-to-r from-emerald-500 via-cyan-500 to-blue-500 transition-all duration-300"
                          style={{ width: `${progress}%` }}
                        />
                      </div>
                    </div>

                    <button
                      onClick={toggleMute}
                      className="p-4 hover:bg-white/10 rounded-full transition-colors"
                    >
                      {isMuted ? (
                        <VolumeX className="w-6 h-6 text-gray-400" />
                      ) : (
                        <Volume2 className="w-6 h-6 text-gray-400" />
                      )}
                    </button>
                  </div>
                  
                  <div className="relative">
                    <Waveform className="w-full h-16 text-gray-700/30" />
                    <div 
                      className="absolute inset-0 bg-gradient-to-r from-emerald-500/20 via-cyan-500/20 to-blue-500/20 rounded-lg"
                      style={{ clipPath: `inset(0 ${100 - progress}% 0 0)` }}
                    />
                  </div>

                  <audio
                    ref={audioRef}
                    onEnded={() => setIsPlaying(false)}
                    onPause={() => setIsPlaying(false)}
                    onPlay={() => setIsPlaying(true)}
                    preload="auto"
                  />
                </div>
              </div>
            )}

            {/* Image Preview */}
            {activeTab === 'image' && imageUrl && (
              <div className="bg-white/5 backdrop-blur-lg rounded-3xl p-6 shadow-xl border border-white/10">
                <img 
                  src={imageUrl} 
                  alt="Uploaded image" 
                  className="w-full h-96 object-contain bg-black/20 rounded-xl p-4"
                />
              </div>
            )}

            {/* Analysis Button */}
            {((activeTab === 'audio' && audioFile) || (activeTab === 'image' && imageFile)) && (
              <button
                onClick={() => analyzeEmotion(activeTab)}
                disabled={activeTab === 'audio' ? isAnalyzing : isAnalyzingImage}
                className="w-full bg-gradient-to-r from-emerald-600 via-cyan-600 to-blue-600 hover:from-emerald-700 hover:via-cyan-700 hover:to-blue-700
                         text-white py-5 px-8 rounded-2xl font-medium text-lg transition duration-300
                         disabled:from-gray-600 disabled:to-gray-700 disabled:cursor-not-allowed
                         flex items-center justify-center shadow-lg hover:shadow-emerald-500/25"
              >
                {(activeTab === 'audio' ? isAnalyzing : isAnalyzingImage) ? (
                  <>
                    <RefreshCw className="w-6 h-6 mr-3 animate-spin" />
                    Analyzing {activeTab}...
                  </>
                ) : (
                  `Analyze ${activeTab}`
                )}
              </button>
            )}
          </div>

          {/* Results Section */}
          <div className={`space-y-6 transition-all duration-500 ${
            (activeTab === 'audio' ? audioEmotionData : imageEmotionData) ? 'opacity-100' : 'opacity-0'
          }`}>
            {activeTab === 'audio' && renderEmotionResult(audioEmotionData, 'audio')}
            {activeTab === 'image' && renderEmotionResult(imageEmotionData, 'image')}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;